import React from 'react';
import WhatsLogo from '../images/whatsapp-logo.png';

function HomeFooter() {
  return (
    <footer>
      <img src={ WhatsLogo } alt="Link para o whatsapp" className="img-whatsapp" />
    </footer>
  );
}

export default HomeFooter;
